import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import image from './img/floorplans/Wendell_B_Hall_Floor_3.png';

// Mount the React App to the 'root' div in the HTML file
ReactDOM.render(<App />, document.getElementById('root'));


const App = () => {
  // Initial state for roomInfo
  const [roomInfo] = useState([
    { name: 'Wendell B301', size: 'Size: 152 sqft', occupancy: 'Occupancy: Single', isAvailable: 'T'},
    { name: 'Wendell B302', size: 'Size: 300 sqft', occupancy: 'Occupancy: Double', isAvailable: 'F'},
    { name: 'Wendell B303', size: 'Size: 432 sqft', occupancy: 'Occupancy: Quad', isAvailable: 'T'},
    { name: 'Wendell B304', size: 'Size: 500 sqft', occupancy: 'Occupancy: Triple', isAvailable: 'F'},
    { name: 'Wendell B305', size: 'Size: 3000 sqft', occupancy: 'Occupancy: Single', isAvailable: 'T'},
    { name: 'Wendell B306', size: 'Size: 4 sqft', occupancy: 'Occupancy: Quad', isAvailable: 'F'},
    { name: 'Wendell B307', size: 'Size: 152 sqft', occupancy: 'Occupancy: Single', isAvailable: 'T'},
    { name: 'Wendell B308', size: 'Size: 300 sqft', occupancy: 'Occupancy: Double', isAvailable: 'F'},
    { name: 'Wendell B309', size: 'Size: 432 sqft', occupancy: 'Occupancy: Quad', isAvailable: 'T'},
    { name: 'Wendell B310', size: 'Size: 500 sqft', occupancy: 'Occupancy: Triple', isAvailable: 'F'},
    { name: 'Wendell B311', size: 'Size: 3000 sqft', occupancy: 'Occupancy: Single', isAvailable: 'T'},
    { name: 'Wendell B312', size: 'Size: 4 sqft', occupancy: 'Occupancy: Quad', isAvailable: 'F'}
  ]);

  // State to track which rows are expanded
  const [expandedRows, setExpandedRows] = useState([]);

  // Function to handle row expansion
  const toggleExpandRow = (index) => {
    if (expandedRows.includes(index)) {
      setExpandedRows(expandedRows.filter((i) => i !== index));
    } else {
      setExpandedRows([...expandedRows, index]);
    }
  };

  return (
    <div>
      <h1 style={{ marginLeft: '300px', color: 'orange' }}>Whitman College, Wendell Hall, Floor 3</h1>
      <img src={image} alt="HallMap" className="image" />
      <RoomInfoTable
        roomInfo={roomInfo}
        expandedRows={expandedRows}
        toggleExpandRow={toggleExpandRow}
      />
      <h3 style={{ marginLeft: '400px', color: 'orange'}}>Click here to return to floor plans list</h3>
    </div>
  );
};

// Table component
const RoomInfoTable = ({ roomInfo, expandedRows, toggleExpandRow }) => {
  return (
    <table border="1" cellPadding="10">
      <thead>
        <tr>
          <th>Availabilty Info</th>
        </tr>
      </thead>
      <tbody>
        {roomInfo.map((oneRoomInfo, index) => (
          <React.Fragment key={index}>
            <tr>
              <td onClick={() => toggleExpandRow(index)} style={{ cursor: 'pointer' }}>
              <div style={{ display: 'inline-flex', alignItems: 'center' }}>
                  <div
                    style={{
                      width: '10px',
                      height: '10px',
                      backgroundColor: oneRoomInfo.isAvailable === 'T' ? 'green' : 'red',
                      borderRadius: oneRoomInfo.isAvailable === 'T' ? '50%' : '0',
                      marginRight: '10px'
                    }}
                  ></div>
                  <strong>{oneRoomInfo.name}</strong> {expandedRows.includes(index) ? '➖' : '➕'}
              </div>
              </td>
            </tr>
            {/* Expanded Row */}
            {expandedRows.includes(index) && (
              <tr>
                <td colSpan="3">
                  <div style={{ padding: '10px', backgroundColor: '#f9f9f9' }}>
                    <strong>{oneRoomInfo.size}</strong> <br></br> <strong>{oneRoomInfo.occupancy}</strong>
                  </div>
                </td>
              </tr>
            )}
          </React.Fragment>
        ))}
      </tbody>
      {/* Table footer for the legend */}
      <tfoot>
        <tr>
          <td>
            <strong>Draw Availability Key</strong><br></br>
            {/* Key/Legend - stacked vertically */}
            <div style={{ display: 'block', marginTop: '10px' }}>
              {/* First row for Available */}
              <div style={{ marginBottom: '5px', display: 'flex', alignItems: 'center' }}>
                <div
                  style={{
                    width: '10px',
                    height: '10px',
                    backgroundColor: 'green',
                    borderRadius: '50%',
                    marginRight: '5px'
                  }}
                ></div>
                <span>Available</span>
              </div>

              {/* Second row for Unavailable */}
              <div style={{ display: 'flex', alignItems: 'center' }}>
                <div
                  style={{
                    width: '10px',
                    height: '10px',
                    backgroundColor: 'red',
                    marginRight: '5px'
                  }}
                ></div>
                <span>Unavailable</span>
              </div>
            </div>
          </td>
        </tr>
      </tfoot>
    </table>

  );
};

export default App;
